// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract ShamirsSecretSharing {
    uint256 constant PRIME = 2 ** 127 - 1;

    function evalAt(uint256[] memory poly, uint256 x) internal pure returns (uint256) {
        uint256 accum = 0;
        for (uint256 i = poly.length; i > 0; i--) {
            accum = accum * x + poly[i - 1];
            accum %= PRIME;
        }
        return accum;
    }

    function makeRandomShares(uint256 secret, uint256 minimum, uint256 shares) external pure returns (uint256[][] memory) {
        require(minimum <= shares, "Minimum should be less than or equal to shares");
        uint256[] memory poly = new uint256[](minimum);
        poly[0] = secret;
        uint256 randomSeed = 0xdeadbeef;
        for (uint256 i = 1; i < minimum; i++) {
            randomSeed ^= i;
            poly[i] = uint256(keccak256(abi.encodePacked(randomSeed))) % (PRIME - 1);
        }

        uint256[][] memory points = new uint256[][](shares);
        for (uint256 i = 1; i <= shares; i++) {
            points[i - 1][0] = i;
            points[i - 1][1] = evalAt(poly, i);
        }
        return points;
    }

    function extendedGcd(uint256 a, uint256 b) internal pure returns (uint256, uint256) {
        int256 x = 0;
        int256 lastX = 1;
        int256 y = 1;
        int256 lastY = 0;

        while (b != 0) {
            int256 quotient = int256(a / b);
            (a, b) = (b, a % b);
            (x, lastX) = (lastX - quotient * x, x);
            (y, lastY) = (lastY - quotient * y, y);
        }
        return (uint256(lastX), uint256(lastY));
    }

    function divmod(uint256 num, uint256 den) internal pure returns (uint256) {
        (uint256 inv, ) = extendedGcd(den, PRIME);
        return num * inv % PRIME;
    }

    function lagrangeInterpolate(uint256 x, uint256[] memory x_s, uint256[] memory y_s) internal pure returns (uint256) {
        require(x_s.length == y_s.length, "Arrays should have equal length");

        uint256 k = x_s.length;
        uint256 num;
        uint256 den;
        uint256[] memory nums = new uint256[](k);
        uint256[] memory dens = new uint256[](k);

        for (uint256 i = 0; i < k; i++) {
            uint256[] memory others = new uint256[](k - 1);
            uint256 cur = x_s[i];
            uint256 index = 0;
            for (uint256 j = 0; j < k; j++) {
                if (j != i) {
                    others[index++] = x_s[j];
                }
            }
            nums[i] = 1;
            for (uint256 j = 0; j < k - 1; j++) {
                nums[i] = nums[i] * (x - others[j]) % PRIME;
            }
            dens[i] = 1;
            for (uint256 j = 0; j < k - 1; j++) {
                dens[i] = dens[i] * (cur - others[j]) % PRIME;
            }
        }

        for (uint256 i = 0; i < k; i++) {
            num = (num + divmod(nums[i] * dens[i] % PRIME * y_s[i] % PRIME, dens[i])) % PRIME;
            den = (den + PRIME - divmod(nums[i], dens[i])) % PRIME;
        }
        return divmod(num, den);
    }

    function recoverSecret(uint256[][] memory shares) external pure returns (uint256) {
        require(shares.length >= 3, "Need at least three shares");

        uint256[] memory x_s = new uint256[](shares.length);
        uint256[] memory y_s = new uint256[](shares.length);

        for (uint256 i = 0; i < shares.length; i++) {
            x_s[i] = shares[i][0];
            y_s[i] = shares[i][1];
        }

        return lagrangeInterpolate(0, x_s, y_s);
    }
}

